  [],\n\t\"revision_timestamp\": \"2015-05-07T06:09:08.030161\",\n\t\"name\": \"three-phase-resonant-dc-power-converter-for-ion-thrusters-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \" Our phase 1 study has revealed many significant
  benefits of a new class of DC-to-DC power converters with performance that cannot
  be matched by current flight power systems.rn The goal of low stored energy has
  been demonstrated while producing a record-breaking efficiency of 95.5&#37;. This
  new converter claims this remarkable accomplishment not at just one full power point
  but at two distinct points. The converter was able to delivery its full rated power
  of 1kW at 2850V and 5000V load voltages without any physical adjusts.rn This new
  converter demonstrated low arc energy and rapid recovery response while powering
  NEXIS like sub-scale ion optics at Colorado State University. The 1kW prototype's
  stored energy was less than 1.9mj at 5000Voutput and less than 700?j at 2850V output.
  rnIn phase 2 we will integrate this new technology into a computerized ion thruster
  test system capable of delivering 24kW screen power. The planned test system will
  serve to gain confidence with the new topology and to initiate power system designers
  to an exciting new technology.rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
